    showEmpresas() {
        const data = (this.props.empresadata)
        const query=(this.props.empresadata)
        return data.data.map((prop, key) => {
            return (
                <tbody key={key}>
                    <tr>
                        <th key={prop._id} className="text-right">
                            {prop.nombre}
                        </th>


                        <th key={prop._id} className="text-right">
                            {prop.correo}
                        </th>

                        <th key={prop._id} className="text-right">
                            {prop.canton}
                        </th>

                        <th key={prop._id} className="text-right">
                            {prop.provincia}
                        </th>
                    </tr>
                </tbody>
            );
        })
    }

    render() {
        return (
            <>
                <Table responsive>
                    <thead className="text-primary">
                        <tr>
                            {thead.map((prop, key) => {
                                if (key === thead.length - 1)
                                    return (
                                        <th key={key} className="text-right">
                                            {prop}
                                        </th>
                                    );
                                return <th key={key}>{prop}</th>;
                            })}
                        </tr>
                    </thead>
                    {this.showEmpresas()}
                </Table>
            </>
        );
    }
}

// export default graphql(getEmpresas)(TablesEmpresas);
export default TablesEmpresas;
